import React from 'react';
import {Route, NavLink, Switch} from 'react-router-dom';
// import TeacherBody from './TeacherBody'
// import TeacherLogin from './TeacherLogin'
import UploadTeacher from './UploadTeacher'
import teachersingle from './teachersingle'
import TeacherDashboard from './TeacherDashboard'
   
const TeacherHeader = ()=>{
    return(

        // <div>This is Teacher header section..</div>
        <div>
        
        <NavLink to="/UploadTeacher">UploadTeacher</NavLink>
        <NavLink tp="/TeacherDashboard">TeacherDashboard</NavLink>
        <Switch>
        {/* <Route path="/test" component={TeacherLogin}/> */}
        {/* <Route path="/" component={TeacherBody}/> */}
        <Route path="/UploadTeacher" component={UploadTeacher}/>
        <Route path="/teachersingle/:id" exact component={teachersingle}/> 
        <Route path="/TeacherDashboard" exact component={TeacherDashboard}/>

        </Switch>

        </div>
    )
}




export default TeacherHeader;
